def numDuplicates(names, prices, weights):
    # Write your code here
    sumnew = []
    for i in range(len(names)):
        if (names[i], (prices[i], weights[i])) not in set(sumnew):
            sumnew.append((names[i], (prices[i], weights[i])))
    #print sumnew
    return len(names)-len(sumnew)

